import React, {Component} from 'react';

class Competencias extends Component{
    constructor(props){
        super(props);
        this.state = {
            competencias: props.items
        }
    }

    render(){
        return(
            <div nameClass="list-competencias">
                {this.state.competencias.map(value => {
                            return (<Competencia nome={value.nome} img={value.imgCompetencia} descricao={value.descricaoCompetencia} />);
                        }
                    )
                }
            </div>
        );
    }
}

export default Competencias;
